INSERT INTO `posts` (`id`, `title`, `content`, `img`, `created_at`, `updated_at`) VALUES
(1, 'What is Webmail ?', 'လုပ်ငန်းလုပ်ကိုင်နေပြီဆိုရင် Webmailကိုအသုံးပြုမှ ပိုအဆင်ပြေနိုင်ပါမယ် ။\r\n\r\n👉Gmail နဲ့ Webmail ရဲ့ ကွာခြားချက်ကတော့ Gmail ဆိုတာ (ဥပမာ ---@gmail.com)ဒီလို ပုံစံရှိပြီး Webmailဆိုတာ (ဥပမာ-----@companyname.com)ဒီလို ပုံစံရှိပါတယ်။\r\n👉Webmail ကို ဘာကြောင့်သုံးသင့်လဲဆိုရင် free ရတဲ့ gmail ဆိုတာ လူတိုင်းသုံးလို့ရနေတဲ့ အရာပါ။ Webmail ဆိုတာ ကိုယ့်ကုမ္ပဏီရဲ့ နာမည်ပါတာကြောင့် ဆင်တူယိုးမှားဖွင့်ပြီးသုံးလို့မရပါဘူး။ 📧Webmail ကိုအသုံးပြုပြီး ကုမ္ပဏီနာမည်နဲ့ မေးလ်ပို့တဲ့အခါ တစ်ဖက်က Client ရဲ့အသိအမှတ်ပြုခြင်းနဲ့ ကုမ္ပဏီကိုပါ တစ်ခါတည်း ကြော်ငြာပြီးသားဖြစ်သွားပါမယ်။', '1575045095_webmail.png', '2019-11-29 09:31:35', '2019-11-29 09:31:35'),
(2, 'ဝဘ်ဆိုက်ရှိခြင်းရင် ဘာထူးသွားစေလဲ?', '👉ယနေ့ခေတ်မှာ Website ကမရှိလဲ ဘာမှမဖြစ်ပါဘူးလို့ ထင်နေတဲ့သူတွေ ရှိနေတယ်ဆိုရင်တော့ အဲ့ဒီ့လူကို သင့်ရဲ့ပြိုင်ဘက်စီးပွားရေး လုပ်ငန်းများက အထူးပဲကျေးဇူးတင်မှာဖြစ်ပါတယ်။\r\nဘာလို့လဲဆိုတော့ ယနေ့ခေတ်Digital ခေတ်ကြီးမှာ Customers တွေကိုရယူနိုင်ဖို့၊ ဆွဲဆောင်နိုင်ဖို့ ၊ မိမိလုပ်ငန်းကို ပြသနိုင်ဖို့ website ဟာ အရေးကြီးတဲ့အခန်းကဏ္ဍမှာပါဝင်နေတယ် ဆိုတာကို နိုင်ငံတကာစီးပွားရေးပညာရှင်တော်တော် များများက နားလည်ပြီးသားဖြစ်မှာပါ။\r\n\r\n👉ဈေးကွက် ချဲ့ထွင်ခြင်း\r\nအင်တာနက်သည် အကြီးမားဆုံး အတားအဆီး ဖြစ်သော နယ်မြေ ကွာခြားမှုကို ကျော်လွန်နိုင်ပြီး လူကြီးမင်း၏ ဝယ်ယူသူများသည် မည်သည့်နိုင်ငံကမဆို အင်တာနက်ရှိပါက လူကြီးမင်း၏ ကုန်ပစ္စည်းများကို ဝင်ရောက် လေ့လာနိုင်မည် ဖြစ်သောကြောင့် ဤနည်းအားဖြင့် ဈေးကွက် ချဲ့ထွင်နိုင်ပါသည်။\r\n\r\n👉 ဝဘ်ဆိုက် ရှိခြင်းဖြင့် လူကြီးမင်း၏ လုပ်ငန်းသည် ပိတ်ချိန်မရှိ ၂၄ နာရီ တစ်ပတ် ၃၆၅ ရက် လုံးလုံး လည်ပတ်နေနိုင်မည် ဖြစ်သည်။ မိမိ၏ ဝဘ်ဆိုက်လိပ်စာကို ထည့်ပေးခြင်းဖြင့် လူကြီးမင်း၏ လုပ်ငန်းမှာ အချိန်ပြည့် လည်ပတ်နိုင်မည်ဖြစ်ပြီး၊ ဝယ်ယူသူများကို ဆုံးရှုံးခြင်းမှလည်း ကင်းဝေးစေပါသည်။\r\n\r\n👉Website ဟာ သင့် စီးပွာရေးလုပ်ငန်းတွေရဲ့ဒုတိယ မျက်နှာစာ ဖြစ်နေပါပြီ\r\nWebsite ရှိထားရုံနဲ့ မိမိဝန်ဆောင်မှုများ၊ product များအကြောင်း၊ Information အစုံအလင်များ၊ သတိပေးတားမြစ်ချက်များ၊ အစရှိသဖြင့်မိမိ စီးပွားရေးလုပ်ငန်းရှိ အချက်အလက်များကို လူအများအလွယ်တစ်ကူ ဝင်ရောက်လေ့လာနိုင်အောင် စီစဉ်ထားနိုင်မှာဖြစ်ပါတယ်။ ဒါတင်မကသေးပါဘူး အရောင်းအဝယ်၊ order လက်ခံခြင်း၊ online booking၊ product show စသဖြင့် လိုအပ်ရင်လိုအပ်သလို စီမံရေးသားထားလို့လဲ ရပါသေးတယ်။\r\n\r\n👉ကြော်ငြာခ များစွာ ဈေးနှုန်း သက်သာခြင်း\r\nအင်တာနက်တွင် ဝဘ်ဆိုက် ပြုလုပ်ခြင်းဖြင့် လူကြီးမင်း၏ လုပ်ငန်းကို ဈေးနှုန်းသက်သာပြီး အချိန်ကြာမြင့်စွာ ကြော်ငြာနိုင်ပါသည်။ မိမိ ဝဘ်ဆိုက် အတွင်းရှိ အကြောင်းအရာများကိုလည်း မိမိကိုယ်တိုင် ပြင်နိုင်၊ ပြောင်းလဲနိုင်ပါသည်။ ကိုယ်ပိုင် ဝဘ်ဆိုက် ရှိသည့်အတွက် လူကြီးမင်း၏ ကုန်ပစ္စည်းကို ကြည့်ရှုသူ များပြားလာစေပါသည်။\r\n\r\n👉ယုံကြည်မှု တိုးမြင့်စေခြင်း\r\nဝဘ်ဆိုက် တစ်ခုသည် လူကြီးမင်း၏ အကြောင်းနှင့် လူကြီးမင်းသည် ဝယ်ယူသူများ၏ ယုံကြည်မှု၊ စိတ်ချမှု တို့နှင့် ထိုက်တန်ကြောင်း ဖော်ပြခွင့်ကို ပေးပါသည်။\r\n\r\n👉ဝဘ်ဆိုက် ရှိခြင်းအားဖြင့် လူကြီးမင်း၏ ဝဘ်ဆိုက်ပေါ်တွင် လမ်းနံပါတ်များနှင့် အမှတ်အသားများ ပါသော လမ်းညွှန်မြေပုံ ထည့်သွင်းပေးထားခြင်းဖြင့် ဝယ်ယူသူများမှ ရုံးသို့လာရောက်သည့်အခါ ထိုမြေပုံကို စာရွက်ပေါ်တွင် print ထုတ်၍ ရှာဖွေနိုင်သောကြောင့် လူကြီးမင်း၏ ရုံးခန်းကို အလွယ်တကူ ရှာတွေ့စေနိုင်ပါသည်။\r\n\r\n👉လူကြီးမင်း၏ ဝဘ်ဆိုက်ကို ကြည့်ခြင်းအားဖြင့် လူကြီးမင်း၏ ကုမ္ပဏီ အကြောင်း၊ ကုမ္ပဏီ၏ အောင်မြင်မှုများနှင့် အနာဂတ်တွင် ရရှိနိုင်သော အောင်မြင်မှု များကို သိရှိနိုင်သည့်အတွက် အကျိုးတူ ပူးပေါင်း လုပ်ကိုင်လိုသူများကိုလည်း ဖိတ်ခေါ်ရာရောက်ပါသည်။ ထို့ကြောင့် ကုမ္ပဏီ ကြီးထွားရန် အခွင့်အလမ်းများ ကိုလည်း ရရှိစေနိုင်ပါသည်။', '1575045148_66887861-online-shopping-ecommerce-24-hours-customer-support-service-concept-with-payment-options-isometric-i.jpg', '2019-11-29 09:32:28', '2019-11-29 09:32:28'),
(3, 'What is SSL ?', '1👉SSL(Secure Socket Layer) ဆိုသည်မှာ မိမိ website ထားရှိရာ Server နဲ့ မိမိ computer ကြား တွင်ရှိသော အချက်အလက်များကို ကာကွယ်ပေးရန် လုပ်ဆောင်ပေးသောအရာဖြစ်ပါသည်။\r\n2👉မိမိအချက်အလက်များကို မသာမာသူများထံ မရောက်သွားစေရန် အလွန် အရေးကြီးလှပါသည်။ ဥပမာ တစ်ချို့ online shopping တွင်စျေးဝယ်မည်ဆိုပါက မိမိ၏အချက်အလက်များ ကိုထည့်သွင်းရန်လိုအပ်သလို, ဘဏ်အကောင့်များကိုလည်းထည့်သွင်းထားတက်သောကြောင့် မသာမာသူများထံမရောက်ဖို့မှာအရေးကြီးပါသည်။ SSL (Secure Socket Layer) အသုံးမပြုထားသော website များတွင် မိမိအချက်အလက်များကို ရယူရန်မှာလွယ်ကူလှပါသည်။ နေရာတိုင်းတွင် မသာမာသူများက အမြဲမပြတ်စောင့်ကြည့်နေတက်ပြီး အရာရာတိုင်းကိုမယုံကြည်ရန်အရေးကြီးလှပါသည်။\r\n3👉SSL အသုံးပြုမပြုကို သိရှိရန်မှာလွယ်ကူလှပါသည်။ SSL အသုံးပြုထားသော website တွင် https:// (s) ပါပြီး (s) ဆိုသည်မှာ Secure ဖြစ်ပါသည်။ SSL အသုံးမပြုထားသော website တွင် http:// ဟူ၍ ဖြစ်ပါသည်။\r\n4👉SSL အသုံးပြုသောကြောင့် မိမိ website ဟာ ပိုမိုလုံခြုံစေပြီး မိမိ website သို့ဝင်ရောက်လာသော မိမိ customer များ၏ confidential information တွေကိုကာကွယ်ပေးသောကြောင့် အသုံးပြုသော customer များသာမက မိမိ website ကိုပါကာကွယ်ပေးထားပါသည်။\r\n5👉SSL Certificate ရရှိထားသော Website ဟာ အဆင့်ဆင့်စစ်ဆေးမှုများဖြတ်ကျော်ပြီးမှသာ ရရှိထားခြင်းဖြစ်ပြီး အတုအယောင် Website မဟုတ်ကြောင်း အပြည့်အဝယုံကြည် မှုရှိကြောင်း အာမခံထားပါသည်။', '1575045192_What-is-SSL.png', '2019-11-29 09:33:12', '2019-11-29 09:33:12'),
(4, 'လက်လီရောင်းတာလား ? လက်ကားရောင်းတာလား? အော်ဒါကောက်ပဲလုပ်တာလား?', '👉ဘယ်လိုပဲဖြစ်ဖြစ် Facebook မှာ online shop လေးလုပ်နေသူများအတွက် E-commerce website တစ်ခု ဖန်တီးဖို့ လိုအပ်နေပါပြီ\r\n\r\nE-Commerce Website တစ်ခုပိုင်ဆိုင်ခြင်းရဲ ့ အားသာချက်တွေကတော့\r\n✅customer တွေရဲ့ ဝယ်ယူမှုှုစာရင်းတွေကို ကြည့်ရှုပြီး ဘယ်customer က ဘယ်လိုပစ္စည်းတွေ ကြိုက်နှစ်သက်တယ် ဆိုတာကို အလွယ်တကူသိနိုင်မယ်\r\n✅customer တွေရဲ့ ငွေကြေး သုံးစွဲမှုအပေါ်မူတည်ပြီး သူတို့စိတ်ဝင်စားနိုင်မယ့် promotion အသစ်တွေကိုလည်း ဖန်တီးပေးနိုင်မှာ ဖြစ်ပါတယ် ။\r\n✅မိိမိတို့ ဆီမှာရှိတဲ့ လက်ကျန် stock ကိုလည်း တိုက်ရိုက် control လုပ်နိုင်သည့်အတွက် stock shortage ဖြစ်စရာ မလိုတော့ဘဲ customer တွေလိုအပ်သည့် ပစ္စည်းကို လိုအပ်သည့်အချိန်တိုင်းပေးနိုင်မှာပါ။\r\n✅payment system တွေကိုလည်း cash on delivery တစ်ခုတည်းမဟုတ်ဘဲ အနယ်နယ်အရပ်ရပ်က customer များပါ အလွယ်တကူ ဝယ်ယူနိုင်ရန် MPU/Bank Transfer စနစ်တွေကိုလည်း ထည့်သွင်းအသုံးပြုပေးမှာ ဖြစ်တဲ့အတွက် customer တွေ အဆင်ပြေပြေနဲ့ ဝယ်ယူနိုင်မှာ ဖြစ်ပါတယ်။\r\n✅E- Commerce website တစ်ခု ရေးဆွဲလိုက်ရုုံုဖြင့် မိမိ ကိုယ်တိုင်သာမက customer တွေပါ အဆင်ပြေလွယ်ကူမည့်အပြင် နှစ်ဆယ့်လေးနာရီလုံး ကုန်ကျစရိတ် ပေးစရာမလိုဘဲ မိမိ ကိုယ်စားရောင်းချပေးနေမှာပဲ ဖြစ်ပါတယ်။', '1575045229_66887861-online-shopping-ecommerce-24-hours-customer-support-service-concept-with-payment-options-isometric-i.jpg', '2019-11-29 09:33:49', '2019-11-29 09:33:49'),
(5, 'Domain Name ဆိုတာဘာလဲ?', 'Domain Nameဆိုတာ တကယ်တော့ သင့်website နာမည်ပါဘဲ။ ဆိုလိုတာက အင်တာနက် အသုံးပြုသူတွေက သင့် websiteကို ဝင်ရောက်ကြည့်ရှုနိုင်တဲ့ လိပ်စာနာမည်ပါ။\r\n\r\nကွန်ပျူတာအချင်းချင်း ကြိုးမဲ့ဆက်သွယ်ဆောင်ရွက်တဲ့အခါ IP address (အစဉ်လိုက်နံပါတ်)တွေနဲ့ အလုပ်လုပ်ပါတယ်။ ဥပမာ. 216.58.196.174 ။ လူတွေက အဲဒီကိန်းဂဏန်းတွေကို မှတ်မိဖို့ရန် (သို့) နားလည်ဖို့ရန် ခက်ခဲပါတယ်။ ဒီတော့ အဲ့ဒီ IP addressတွေကို လူတွေနားလည်လွယ်ကူအောင် ဖော်ပြထားတဲ့နာမည်ကို Domain Name လို့ခေါ်တယ်။\r\n\r\nDomain Name တစ်ခုမှာ letterတွေ၊ numberတွေပါဝင်နိုင်ပါတယ်။ ပြီးပြည့်စုံတဲ့ Domain Name တစ်ခုဖြစ်ဖို့ရာ အဲဒီ Domain Nameတွေကို Domain Name Extension (e.g. .com, .net, shop, etc.,) တွေနဲ့တွဲဆက်ပြီး အသုံးပြုရပါတယ်။ ဥပမာ. www.facebook.com , www.amazon.com , www.alibaba.com .\r\n\r\nDomain Name တစ်ခုကို အသုံးမပြုခင်မှာ register အရင်လုပ်ရပါတယ်။ Domain Name တစ်ခုနဲ့တစ်ခု (လုံးဝ)တူလို့ မရပါဘူး။ ဆိုလိုတာက website နှစ်ခုက တူညီတဲ့ domain name တစ်ခုကိုဘဲ သုံးလို့မရပါဘူး။ အဲဒီတော့ အခုကိုယ်က Domain Nameအသစ်တစ်ခုလိုချင်တယ်ဆိုရင် အဲဒီ Nameကို သုံးနေတဲ့သူရှိလား? မရှိဘူးလား? ဆိုတာကို စစ်ဆေးပြီး သုံးတဲ့သူမရှိသေးဘူးဆိုတော့မှ register လုပ်လို့ရမှာပါ။\r\n\r\nDomain Name ကို ကိုယ်ပိုင်website တစ်ခုတည်းအတွက် အသုံးပြုနေတာတော့ မဟုတ်ပါဘူး။ ကိုယ်ပိုင်email တွေဖန်တီးနိုင်ဖို့အတွက်လည်း အသုံးပြုပါတယ်။', '1575045262_domain-name-structure-diagram-1956x936.png', '2019-11-29 09:34:22', '2019-11-29 09:34:22');

